var GuideData = {"adamstown-awabakal-adamstown":{"location":"Awabakal","lon":151.729788,"lat":-32.997962,"description":["The <a href=\"http://www.railtrails.org.au/trail?view=trail&id=80\">Fernleigh track</a> is an old railway line from Newcastle to Lake Macquarie that has been turned into a bike path. The platforms of the stations are still visible along the way and food and drinks conveniently available nearby every stop.","<a href=\"http://www.environment.nsw.gov.au/NationalParks/parkHome.aspx?id=N0522\">Awabakal</a> is a nature reserve in the middle of suburban Newcastle. Despite the encroachment of the surrounding suburbs, the coastal heath and lagoon are in breathtaking condition."],"duration":7,"distance":30,"zoom":13,"rain":false,"fireban":false,"gps":"adamstown-awabakal-adamstown","bounds":{"west":151.688232421875,"north":-32.9164853473144,"east":151.754150390625,"south":-33.02708758002872},"markers":[{"location":"Adamstown","type":"train","description":"Get the train to Adamstown using <a href=\"https://transportnsw.info/trip#/?to=Adamstown\">transportnsw.info</a>.","lon":151.720030345,"lat":-32.9337152839},{"type":"kiosk","lat":-32.978277000000006,"lon":151.708188},{"type":"kiosk","lat":-33.01304,"lon":151.718354},{"type":"kiosk","lat":-32.989667000000004,"lon":151.719252},{"type":"toilet","lat":-32.977214000000004,"lon":151.708441},{"type":"toilet","lat":-33.013643,"lon":151.719724},{"type":"toilet","lat":-32.99179,"lon":151.717743},{"type":"waypoint","photo":"pb130003.jpg","lon":151.71998888888888,"lat":-32.93410833333333,"description":"Exit the station and follow Park Avenue."},{"type":"waypoint","photo":"pb130004.jpg","lon":151.71791944444445,"lat":-32.93561388888889,"description":"Where Park Avenue turns right, cross the street to get to the start of the Fernleigh Track."},{"type":"waypoint","photo":"pb130005.jpg","lon":151.7176888888889,"lat":-32.93580277777777,"description":"The old train line is now a foot/bike path, which this walk follow all the way to Redhead."},{"type":"waypoint","photo":"pb130012.jpg","lon":151.7185388888889,"lat":-32.96175277777778,"description":"The path crosses roads several times along the way."},{"type":"waypoint","photo":"pb130017.jpg","lon":151.7111138888889,"lat":-32.97754444444445,"description":"<i>+ 0.5h / 1km</i> There's shops, restaurants and a public toilet near the track at the former Whitebridge station.","optional":true},{"type":"waypoint","photo":"pb130016.jpg","lon":151.71156944444442,"lat":-32.97732777777778,"description":"Take the path on the right of the track before up to the street above.","optional":true},{"type":"waypoint","photo":"pb130018.jpg","lon":151.7101361111111,"lat":-32.976819444444445,"description":"At the first intersection follow the road to the left.","optional":true},{"type":"waypoint","photo":"pb130020.jpg","lon":151.70810277777775,"lat":-32.97796666666667,"description":"Whitebridge's shops are to the left of the roundabout a short distance down the road.","optional":true},{"type":"waypoint","photo":"pb130021.jpg","lon":151.71052777777777,"lat":-32.97830277777778,"description":"Continue on down the Fernleigh track, past the Whitebridge sign."},{"type":"waypoint","photo":"pb130027.jpg","lon":151.7080861111111,"lat":-33.00695,"description":"After reaching the next station (Redhead) along the line, continue past the first sign to Redhead Beach."},{"type":"waypoint","photo":"pb130028.jpg","lon":151.7062222222222,"lat":-33.008383333333335,"description":"Follow the second sign to Redhead Beach after the old platform, past the sports fields."},{"type":"waypoint","photo":"pb130029.jpg","lon":151.7073361111111,"lat":-33.008894444444444,"description":"At the end of the sports fields, turn right to follow Elsdon Street."},{"type":"waypoint","photo":"pb130030.jpg","lon":151.70713055555555,"lat":-33.01181111111111,"description":"At the intersection with Kalaroo Road turn left to keep following Elsdon Street."},{"type":"waypoint","photo":"pb130033.jpg","lon":151.70744444444443,"lat":-33.014583333333334,"description":"A short diatnce after Elsdon Street turns left, enter the trackhead on the right of the road."},{"type":"waypoint","photo":"pb130034.jpg","lon":151.70749999999998,"lat":-33.014602777777775,"description":"From the trackhead follow the trail to left towards the beach."},{"type":"waypoint","photo":"pb130045.jpg","lon":151.7162361111111,"lat":-33.01458888888889,"description":"Follow the boardwalk through the wetlands and coastal heath until it leads back to the street to the left."},{"type":"waypoint","photo":"pb130046.jpg","lon":151.71621666666667,"lat":-33.013641666666665,"description":"The boardwalk finally ends at a reserve along Beach Road."},{"type":"waypoint","photo":"pb130047.jpg","lon":151.71690833333332,"lat":-33.012816666666666,"description":"From the reserve cross the creek across the bridge."},{"type":"waypoint","photo":"pb130048.jpg","lon":151.7174388888889,"lat":-33.0127,"description":"You can visit the surf club to the right first, or head left up Alison Street."},{"type":"waypoint","photo":"pb130050.jpg","lon":151.71959444444445,"lat":-33.010175,"description":"Alison Street turn right onto Collier Street. Follow it to the top of the hill."},{"type":"waypoint","photo":"pb130053.jpg","lon":151.72491666666667,"lat":-33.010844444444444,"description":"Halfway up Collier Street, at the top of the hill, a sign and a faint bushtrail allow entry into Awabakal."},{"type":"waypoint","photo":"pb130055.jpg","lon":151.72525555555555,"lat":-33.01043333333333,"description":"After initial dense vegetation the trail open up to wide views across the coastal heath."},{"type":"waypoint","photo":"pb130058.jpg","lon":151.72813888888888,"lat":-32.997819444444445,"description":"Eventually the trail will join a firetrail, follow it to the right to the lookouts."},{"type":"waypoint","photo":"pb130071.jpg","lon":151.7297888888889,"lat":-32.99796111111111,"description":"At the end of the firetrail a few faint bushtrails lead to views up and down the coast."},{"type":"waypoint","photo":"pb130074.jpg","lon":151.72770555555556,"lat":-32.99659166666667,"description":"Return back down the firetrail until it eventually reaches a picnic table."},{"type":"waypoint","photo":"pb130076.jpg","lon":151.7256277777778,"lat":-32.99628611111111,"description":"From the picnic table follow the firetrail to the left, downhill to the lagoon."},{"type":"waypoint","photo":"pb130078_pb130086.jpg","lon":151.72459166666667,"lat":-32.99761111111111,"description":"Turn left at the lagoon and walk around it clockwise."},{"type":"waypoint","photo":"pb130088.jpg","lon":151.71729444444443,"lat":-32.99447222222222,"description":"On the far side of the lagoon the firetrail splits into several grassy paths, all of which lead out of the park."},{"type":"waypoint","photo":"pb130090.jpg","lon":151.7180361111111,"lat":-32.992805555555556,"description":"The trail out of Awabakal end at some sports fields. Walk along the fields to get to the street on the other side."},{"type":"waypoint","photo":"pb130092.jpg","lon":151.71825555555554,"lat":-32.989308333333334,"description":"Follow the street up to its junction with Ocean Street and follow it to the right."},{"type":"waypoint","photo":"pb130094.jpg","lon":151.7229111111111,"lat":-32.98976944444445,"description":"There's several pubs along Ocean Street. Continue along the street and turn left into Bombala Street."},{"type":"waypoint","photo":"pb130097.jpg","lon":151.7257888888889,"lat":-32.98606111111111,"description":"Follow Bombala Street all the way to the end to find the trailhead into Glenrock."},{"type":"waypoint","photo":"pb130100.jpg","lon":151.72721666666666,"lat":-32.98343333333334,"description":"Start down the trail, taking the right forks to pass by several lookouts."},{"type":"waypoint","photo":"pb130101_pb130106.jpg","lon":151.72719722222223,"lat":-32.98246944444445,"description":"The trail eventually ends on Dudley Beach near a creek. Continue along the beach."},{"type":"waypoint","photo":"pb130123.jpg","lon":151.73155555555556,"lat":-32.97172777777778,"description":"Near the end of the beach well past the carpark a worn path leads up from the beach to a firetrail."},{"type":"waypoint","photo":"pb130125.jpg","lon":151.73036666666667,"lat":-32.97091944444445,"description":"Follow the gravel firetrail away from the beach through the coast heath."},{"type":"waypoint","photo":"pb130126.jpg","lon":151.72917222222222,"lat":-32.96961666666667,"description":"The trail turns into a dirt road through higher growth, a well worn bike run on the right leads up the hill."},{"type":"waypoint","photo":"pb130129.jpg","lon":151.73130833333335,"lat":-32.967711111111115,"description":"Climb the worn path all the way to the top of the hill, and folow the firetrail it joins to the right."},{"type":"waypoint","photo":"pb130134.jpg","lon":151.73528055555553,"lat":-32.966033333333336,"description":"Near the end of the firetrail a wooden staircase indicates a winding descent to the next beach."},{"type":"waypoint","photo":"pb130135_pb130141.jpg","lon":151.73612777777777,"lat":-32.965022222222224,"description":"The trail passes along the campground of the nearby scouting camp on it's way to the beach."},{"type":"waypoint","photo":"pb130153_pb130162.jpg","lon":151.7379111111111,"lat":-32.96234722222223,"description":"Follow the beach past the lagoon and follow the creek up from there."},{"type":"waypoint","photo":"pb130163.jpg","lon":151.73760277777777,"lat":-32.96225277777778,"description":"Great North Walk signs indicate where a walking path away from the beach starts."},{"type":"waypoint","photo":"pb130165.jpg","lon":151.7367833333333,"lat":-32.96188055555556,"description":"Follow the directions to the trackhead on the various signs along the way."},{"type":"waypoint","photo":"pb130174.jpg","lon":151.72169722222222,"lat":-32.95762777777778,"description":"It's easiest to follow the Great North Walk markers through the maze of tracks and trails."},{"type":"waypoint","photo":"pb130177.jpg","lon":151.71851944444444,"lat":-32.95831666666667,"description":"Eventually all the trails join back up with the Gernleigh Track. Which one you follow isn't that important."},{"type":"waypoint","photo":"pb130180.jpg","lon":151.71815833333335,"lat":-32.955619444444444,"description":"Follow the Fernleigh track back to its start."},{"type":"waypoint","photo":"pb130184.jpg","lon":151.71729722222221,"lat":-32.936077777777776,"description":"At the start of the Fernleigh track, cross the road and follow the footpath back to the train station."},{"location":"Adamstown","type":"train","description":"Plan your return trip from Adamstown at <a href=\"https://transportnsw.info/trip#/?from=Adamstown\">transportnsw.info</a>.","lon":151.7206018232,"lat":-32.9336548503}]}};